description:
Rebecca knows where the mothers are and what kind of filthy, fun frolics they're up to, and she's gathered them here in a mother of a collection. She's found them offering up tempting treats at the bake sale, being raffled off at the flea market, getting unholy in the church pews and disrobing at the school bus stop. They're out and about at the pool, the waxing salon, and the comic convention. They're outside in the yard, flashing the neighbors, and getting cozy with the teen girl down the street. They're enjoying themselves -- and each other -- right at home sweet home. And nobody captures their sultry, slutty escapades like the one and only Rebecca. Yes, these sapphic suburban sirens aren't hard to find if you know where to look -- right here in these pages!


And for those of you that don't know CBR and CBZ files, CBR is renamed .rar files and CBZ are renamed .zip files, and they are the normal way to share comic scans. You can either download free CBR readers (just google it, I recommend GonVisor myself) or unpack them and read them in your favorite image reader.
